#include "Scan.h"

#define COEFF(x,y) (data[x+y*BLOCK_SIZE_X])
#define ABS( x )  ( (x>=0)?x:(-x) )
uint8 Scan_ModeDecision( int32* coeff )
{
	int32* data = &coeff[ BLOCK_SIZE_X*BLOCK_SIZE_Y*(BLOCK_SIZE_Z-1) ];
	uint8 i, j;
	uint8 x=0, y=0;
	int32 iMax = 0;

	
	for (j=0; j!=BLOCK_SIZE_Y; j++)
		for(i=0; i!=BLOCK_SIZE_X; i++)
		{
			if( ABS(COEFF(i,j)) > iMax )
			{
				iMax = ABS(COEFF(i,j));
				x = i ;
				y = j ;
			}
		}

	if( x<=1 && y<=2 )
		return MODE_1;

	if( 2<=x && x<=5 && y<=2 )
		return MODE_2;

	if( 6<=x && x<=11 && y<=5 )
		return MODE_3;

	if( x<=1 && 3<=y && y<=6 )
		return MODE_4;

	if( 2<=x && x<=5 && 3<=y && y<=6 )
		return MODE_5;

	if( x<=5 && 7<=y && y<=11 )
		return MODE_6;

	if( x<=16 && y<=16 )
		return MODE_7;


	return MODE_8;
}
#undef COEFF


void  Scan_Sort( int32* coeff, uint8 mode )
{
	const uint16* ScanTable = glbScanTable[mode]; 
	uint16  i;

	int32* tempCoeff = (int32 *)malloc( BLOCK_SIZE_BYTE*sizeof(int32) ) ;
	memcpy( tempCoeff, coeff, BLOCK_SIZE_BYTE*sizeof(int32) ) ;
	i = 0;
	while( i<BLOCK_SIZE_BYTE )
	{
		coeff[i] = tempCoeff[ ScanTable[i] ];
		i++;
	}
	free(tempCoeff);
}


